import './App.css';
import { ThemeProvider } from './ThemeContext';
import Header from './components/header/Header';
import Footer from './components/Footer/footer';
import Main from './components/main/main';
import Content from './Content';

function App() {
  return (
    <ThemeProvider>
      <Header />
      <Main />
      <Content />
      <Footer />
    </ThemeProvider>
  );
}

export default App;
